import React from "react";
import "./Navigation.css";

class Navigation extends React.Component {
  navigationItems = [];

  render() {
    return (
      <nav>
        <span
          style={{
            color: "#4285f4",
          }}
        >
          DLSU GDG
        </span>
      </nav>
    );
  }
}

export default Navigation;
